import React from 'react';
import { Link } from 'react-router-dom';
import { Row } from 'react-bootstrap';
import AC2 from '../AC2.jpg';

function Navbar() {
  return (
    <div className="navbar navbar-light navbar-expand-md">
      <Row>
        <img src={AC2} alt="animal crossing" className="nav-img" />
      </Row>
      <Row>
        <nav className="navbar navbar-light navbar-expand-md"> 
              Village Watch: New Horizons
              <Link to='/islands' className="link"> All Islands </Link>
              <Link to='/islands/new' className="link"> New Island </Link>
        </nav>
      </Row>
    </div>
  )
}

export default Navbar;
